import { Component } from '@angular/core';
import { NavController } from 'ionic-angular';

import { Base64ToGallery } from 'ionic-native'
/*
  Generated class for the SaveImageGallery page.

  See http://ionicframework.com/docs/v2/components/#navigation for more info on
  Ionic pages and navigation.
*/
@Component({
  selector: 'page-save-image-gallery',
  template: `
<ion-header>

  <ion-navbar>
    <ion-title>SaveImageGallery</ion-title>
  </ion-navbar>

</ion-header>


<ion-content padding>

<img src="{{imageLogo}}">
<button (click)="saveToGallery(imageLogo)">save to gallery</button>

</ion-content>
`
})
export class SaveImageGalleryPage {

  imageLogo: string = 'data:image/png;base64,'

  constructor(public navCtrl: NavController) {}

  ionViewDidLoad() {
    console.log('Hello SaveImageGalleryPage Page');
  }

  saveToGallery(base64: string) : void {

    const options = {
      prefix: 'pluginSample_',
      format: 'png',
      mediaScanner: true
    }
    Base64ToGallery.base64ToGallery(base64, options).then(res => {
      console.log(res + "")
    }, err => {
      console.error(err)
    })

  }

}
